import React from 'react';
import { FormControlLabel, Grid, Slider, Switch, Typography } from '@material-ui/core';

function DataControls(props) {
    return(
        <>
            <Typography variant="h6" style={{margin:"20px"}}>Data Controls</Typography>

            <div id="UniqueValsControl" style={{margin: "25px"}}>
                <FormControlLabel
                    control={
                    <Switch
                        checked={true}
                        color="primary"
                    />
                    }
                    label="Unique Values"
                />
            </div>

            <div id="DataSizeControl" style={{margin:"20px"}}>
                <Typography variant="body1">Data Size</Typography>
                <Grid container spacing={2}>
                    <Grid item>
                        <Typography variant="body1">10</Typography>
                    </Grid>
                    <Grid item xs>
                        <Slider 
                            value={props.size} 
                            onChange={(event, newValue) => {props.setSize(newValue/100*250)}}
                        />
                    </Grid>
                    <Grid item>
                        <Typography variant="body1">1000</Typography>
                    </Grid>
                </Grid>
            </div>
        </>
    );
}

export default DataControls;
